import React from 'react';
import { Navbar, Nav, Form, FormControl, Button } from 'react-bootstrap';
import { NavHeader } from './HeaderStyle';
import { ButtonSearch } from '../Buttons/Button';

const Header = ({
    titleBrand, labelButton
}) => (
  <NavHeader expand="lg">
    <Navbar.Brand href="#home">{titleBrand}</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
      <Nav >
        <Nav.Item>
          <Form inline>
              <FormControl type="text" placeholder="Search" className="mr-sm-2" />
            <ButtonSearch  variant="outline-success">{labelButton}</ButtonSearch >
          </Form>
        </Nav.Item>
      </Nav>
    </Navbar.Collapse>
  </NavHeader>
);

export default Header;
